import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import IconButton from '@mui/material/IconButton';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import Divider from '@mui/material/Divider';
import useMediaQuery from '@mui/material/useMediaQuery';
import { useTheme } from '@mui/material/styles'; // Correct import path
import MenuIcon from '@mui/icons-material/Menu';
import CloseIcon from '@mui/icons-material/Close';

const Navbar = () => {
  const { isAuthenticated, logout } = useAuth();
  const navigate = useNavigate();
  const [mobileOpen, setMobileOpen] = useState(false);
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));

  const handleLogout = () => {
    logout();
    navigate('/');
    setMobileOpen(false);
  };

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const navItems = (
    <>
      <Button color="inherit" component={Link} to="/" onClick={() => setMobileOpen(false)}>
        Home
      </Button>
      {isAuthenticated ? (
        <>
          
          <Button color="inherit" component={Link} to="/create-post" onClick={() => setMobileOpen(false)}>
            Create Post
          </Button>
          <Button color="inherit" onClick={handleLogout}>
            Logout
          </Button>
        </>
      ) : (
        <>
          <Button color="inherit" component={Link} to="/login" onClick={() => setMobileOpen(false)}>
            Login
          </Button>
          <Button color="inherit" component={Link} to="/register" onClick={() => setMobileOpen(false)}>
            Register
          </Button>
        </>
      )}
    </>
  );

  const drawer = (
    <Box
      sx={{
        width: 250,
        height: '100%',
        backgroundColor: theme.palette.primary.main,
        color: 'white'
      }}
    >
      <Box sx={{ display: 'flex', justifyContent: 'flex-end', p: 2 }}>
        <IconButton onClick={handleDrawerToggle} color="inherit">
          <CloseIcon />
        </IconButton>
      </Box>
      <Divider />
      <List>
        {[
          { name: 'Home', path: '/' },
          isAuthenticated && { name: 'Dashboard', path: '/dashboard' },
          isAuthenticated && { name: 'Create Post', path: '/create-post' },
          !isAuthenticated && { name: 'Login', path: '/login' },
          !isAuthenticated && { name: 'Register', path: '/register' },
          isAuthenticated && { name: 'Logout', action: handleLogout }
        ]
          .filter(Boolean)
          .map((item) => (
            <ListItem
              button
              key={item.name}
              component={item.action ? undefined : Link}
              to={item.path}
              onClick={item.action || (() => setMobileOpen(false))}
              sx={{
                '&:hover': {
                  backgroundColor: theme.palette.primary.light
                }
              }}
            >
              <ListItemText primary={item.name} />
            </ListItem>
          ))}
      </List>
    </Box>
  );

  return (
    <AppBar position="static" sx={{ mb: 4 }}>
      <Toolbar>
        <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
          <Link to="/" style={{ color: 'white', textDecoration: 'none' }}>
            My Blog
          </Link>
        </Typography>
        
        {isMobile ? (
          <>
            <IconButton
              color="inherit"
              edge="end"
              onClick={handleDrawerToggle}
              sx={{ ml: 2 }}
            >
              <MenuIcon />
            </IconButton>
            <Drawer
              anchor="right"
              open={mobileOpen}
              onClose={handleDrawerToggle}
              sx={{
                '& .MuiDrawer-paper': {
                  backgroundColor: 'transparent',
                },
              }}
            >
              {drawer}
            </Drawer>
          </>
        ) : (
          <Box sx={{ display: 'flex' }}>{navItems}</Box>
        )}
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
